import React, { Component } from 'react'
import './Header.scss'

interface HeaderState {
  navigationId: string;
}

export default class Header extends Component<{},HeaderState> {
  state = {
      navigationId: "",
  }

  render() {
    return (
      <div className="header">
        <div className="left-section">
          <img src="" alt="" />
        </div>
      </div>
    )
  }
}
